import React from 'react';
import './App.css';
import Filter from './components/Filter'
import DogBar from './components/DogBar'
import RenderDog from './components/RenderDog'

class App extends React.Component {

  constructor() {
    super()

    this.state = {
      dogs: [],
      selectedDog: [],
    }
  }

  render() {
    return (
      <div className="App">
        <div id="filter-div">
          <Filter />
        </div>
        <div id="dog-bar">
          <DogBar dogs={this.state.dogs} />
        </div>
        <div id="dog-summary-container">
          <h1>DOGGO:</h1>
          <div id="dog-info">
            <RenderDog />
          </div>
        </div>
      </div>
    );
  }

  componentDidMount() {
    fetch('http://localhost:3001/pups')
    .then(resp => resp.json())
    .then(dogs => {
      this.setState({dogs})
    })
  }
}

export default App;
